// src/App.js
import React, { useState } from 'react';
import CardSwiping from './CardSwiping';
import './index.css';
import house1 from './images/3589669_2.jpg';
import house1_1 from './images/house1_1.jpg';
import house1_2 from './images/house_1_2.jpg';
import house2 from './images/3589453_0.jpg';

function App() {
  const [house, setHouse] = useState([
    { name: 'House 5', images: [house1, house1_1, house1_2] },
    { name: 'House 4', images: [house2, house2] },
    { name: 'House 3', images: [house1] },
    { name: 'House 2', images: [house1, house1_1] },
    { name: 'House 1', images: [house2, house1, house2] }
  ]);

  const swiped = (direction, name) => {
    console.log(`You swiped ${direction} on ${name}`);
  };

  return (
    <div className="app">
      <div className="cardContainer">
        {house.map((house, index) => (
          <CardSwiping key={index} house={house} onSwipe={swiped} />
        ))}
      </div>
    </div>
  );
}

export default App;
